// ==UserScript==
// @name        GreasyFork Script Icon
// @name:zh-CN  GreasyFork 脚本图标
// @name:zh-TW  GreasyFork 腳本圖標
// @name:ru     Иконка скрипта GreasyFork
// @name:ja     GreasyFork スクリプトアイコン
// @name:es     Icono del Script de GreasyFork
// @name:fr     Icône de Script GreasyFork
// @name:de     GreasyFork Skriptsymbol
// @namespace   github.com/hmjz100
// @icon        data:image/png;base64,
// @version     0.0.2
// @author      hmjz100,wOxxOm
// @license     MIT
// @match       *://greasyfork.org/*scripts/*
// @match       *://sleazyfork.org/*scripts/*
// @run-at      document-start
// @connect     *
// @connect     greasyfork.org
// @connect     sleazyfork.org
// @connect     *.greasyfork.org
// @connect     *.sleazyfork.org
// @grant       GM_xmlhttpRequest
// @grant       GM_setValue
// @grant       GM_getValue
// @description Displays the script's icon on its info page from the script meta block
// @description:zh-CN 在脚本信息页面上显示来自脚本元数据的图标
// @description:zh-TW 在腳本信息頁面上顯示來自腳本元數據的圖標
// @description:ru Отображает иконку скрипта на странице информации о скрипте из блока метаданных скрипта
// @description:ja スクリプトのメタブロックからスクリプト情報ページにアイコンを表示します
// @description:es Muestra el ícono del script en la página de información del script desde el bloque de metadatos del script
// @description:fr Affiche l'icône du script sur la page d'informations du script à partir du bloc de métadonnées du script
// @description:de Zeigt das Symbol des Skripts auf der Informationsseite des Skripts aus dem Metadatenblock des Skripts an
// @downloadURL https://update.greasyfork.org/scripts/503675/GreasyFork%20Script%20Icon.user.js
// @updateURL https://update.greasyfork.org/scripts/503675/GreasyFork%20Script%20Icon.meta.js
// ==/UserScript==

// 获取当前脚本的 ID
const scriptID = location.href.match(/scripts\/(\d+)/)[1];
let cacheIcon = GM_getValue(scriptID);
let defaultIcon = "data:image/png;base64,"

// 如果已有图标，直接添加
if (cacheIcon && /^(data:image|https:)/.test(cacheIcon)) {
	(cacheIcon === "none") ? addIcon(defaultIcon, true) : addIcon(cacheIcon, true)
} else {
	// 获取脚本的用户脚本文件
	GM_xmlhttpRequest({
		method: 'GET',
		url: location.pathname.replace(/(scripts\/\d+[^/]+)(\/.*)?$/, '$1/code/1.user.js'),
		timeout: 10000,
		onload: function (response) {
			// 提取图标 URL
			let url = (response.responseText.match(/\n\s*\/\/\s+@icon(?:url)?\s+((?:https?:\/\/|data:image\/).+)|$/i) || [])[1]?.trim();
			let dontCache = false
			if (!url) {
				url = defaultIcon
				dontCache = true
			}

			// 如果 URL 是 HTTP(s)，则添加图标
			if (/^https?:/.test(url)) {
				addIcon(url, dontCache);
			} else {
				const base64Data = url.split(',')[1];
				const sizeInBytes = atob(base64Data).length;
				if (sizeInBytes <= 40) {
					console.log('Data image icon is too small (<= 40 bytes), ignoring');
					url = defaultIcon
					dontCache = true
				}
				addIcon(url, dontCache);
			}
		}
	});
}

// 添加图标到页面
function addIcon(url, dontCache) {
	cacheIcon = url;
	const header = document.querySelector('#script-info header h2');

	if (header) {
		insertIcon(header);
	} else {
		// 等待 h2 元素出现
		const observer = new MutationObserver(mutations => {
			mutations.forEach(mutation => {
				if (mutation.target.localName === 'h2') {
					insertIcon(mutation.target, dontCache);
					observer.disconnect();
				}
			});
		});
		observer.observe(document, { subtree: true, childList: true });
	}
}

// 在 h2 元素中插入图标
function insertIcon(header, dontCache) {
	header.insertAdjacentHTML('afterbegin', `
	<span style="display: inline-block;vertical-align: middle;">
	  <img referrer="no-referrer" referrerPolicy="no-referrer" src="${cacheIcon}" style="height: 1em;width: 1em;" onerror="this.src='${defaultIcon}'">
	</span>
	`);
	(dontCache === false) ? GM_setValue(scriptID, cacheIcon) : GM_setValue(scriptID, "none");
}